    return (
        <header>
            <h1>logo</h1>
        </header>
    )
}

const Nav = () => {
    return (
        <nav>
            <ul>
                <li>
                    <a href="#">Home</a>
                </li>
                <li>
                    <a href="#">About</a>
                </li>
                <li>
                    <a href="#">SingIn</a>
                </li>
            </ul>
        </nav>
    )
}

function App() {
    return (
        <div className="wrap">
            <Header />
            <Nav />
            <main>
                <h2>Home</h2>
                <p>Home page content</p>
            </main>
            <footer>
                <p>&copy; 2024</p>
            </footer>
        </div>
    )
}

export default App
